import React from 'react';
import { Card, Col, Row } from 'antd';
import { returnStatement } from '@babel/types';

import './Home.css'

import MainPic from '../pic/MainPic.png' 

class Home extends React.Component{
    render(){
        return(
            <img alt="example" src={MainPic} />
        )
    }
}
export default Home;
